INSERT INTO `reply` VALUES (1,2,'Parketti','','Parketti on lämmin ja pehmeä, mutta kallis ja naarmuuntuva, laminaatti taas kova/kylmä, mutta kestävä riippuen laadusta...',0),(2,3,'','','Kiitos! :)',0),(3,3,'','','Radiossa oli tästä mainos, hyvä sivusto.',0),(4,5,'blogilistalta','','[url=http://susannantyohuone.blogspot.fi/]http://susannantyohuone.blogspot.fi/[/url]\r\n[url=http://remonttireiska.tomstown.pointclark.net/]http://remonttireiska.tomstown.pointclark.net/[/url]\r\n[url=http://koti1898.blogspot.fi/]http://koti1898.blogspot.fi/[/url]',0),(5,7,'sani','','mietin siksi, että rivitaloomme arvioksi annettiin 40t putkiremontti, mutta mitä oikeasti tuli maksamaan, voiko nousta siis paljonkin?',0),(6,9,'minkälaisia','','Saako olla asunnon etsimisestä toistaiseksi kirjoittava?',0),(7,6,'','','MIeluiten remontoitava pienihintainen ja ok alueelta, tulee varmaan edullisimmaksi niin päin ja saa valita itse pintansa. :D',0),(8,11,'','','Voi kirjautua vain ylläpitäjänä?',0),(9,11,'Ylläpito','','Rekisteröitymisen mahdollisuus tulossa piakkoin!',0),(10,9,'Ylläpito','','Sopii hyvin aiheeseen!',0),(11,10,'','','\"Tasakatto on arkkitehtuurissa ulkokattotyyppi, jossa katto on vaakasuorassa. Sadeveden takia tasakatto on aina hivenen kalteva, ja jos se on 1:20, näyttää katto vielä vaakasuoralta. Pulpettikatto on kuitenkin erillinen kaltevampi kattotyyppi.\r\nTasakatto on osa perinteistä rakennustyyliä kuivilla alueilla, kuten Sahelissa Afrikassa, joissakin arabimaissa sekä Meksikon lähellä olevilla autiomaan laitamilla asuvilla intiaaniheimoilla. Suomessa ja muilla lumisade-alueilla perinteeseen kuuluvat harja-, auma-, pulpetti- ja mansardikatto.\r\nTasakatto tuli Euroopassa muotiin modernismin ja funktionalismin myötä, sillä tasakattoisessa rakennuksessa ei ole turhaksi katsottua lämmitettävää tilaa. Esimerkiksi Le Corbusier suosi tasakattoja.\r\nSuomessa tasakatot tulivat muotiin 1960-luvulla teollisen elementtitekniikan myötä. Ajan rakennustekniikka ei aina ollut riittävän kehittynyttä, ja tasakatot tuottivat runsaasti ongelmia.[1] Modernit tasakattorakenteet ja -materiaalit ovat kehittyneempiä. Nykyisin tasakatot tehdään pääosin liike- ja julkisiin rakennuksiin.\"',0);
/*!40000 ALTER TABLE `reply` ENABLE KEYS */;
UNLOCK TABLES;

