INSERT INTO `room` VALUES (1,'Yleinen keskustelu','Eikö aiheesi täsmää mihinkään valmiiseen huoneeseen? Keskustele täällä siitä!',0,0),(2,'Piha','Miten teen kuistin, mitä kukkia on helppo istuttaa? Keskustele täällä piha-aiheista.',2,0),(3,'Keittiö','Mikä lattia on paras keittiöön, mistä löytyy edulliset materiaalit? Täällä voit puhua keittiöön liittyvistä asioista.',3,0),(4,'Lattiat','Parkettia, laminaattia vai muovia? Mikä kestää meidän kulutusta? Keskustele täällä lattia-aiheista.',4,0),(5,'Kylpyhuone ja wc','Kuinka paljon maksoi teidän kylppäriremppa? Keskustelualue vessoista ja kylppäreistä.',5,0),(6,'Sauna','Miten maalataan sauna, mikä kivi kiukaaseen? Juttele saunaan liittyvistä aiheista täällä.',6,0),(7,'Asunnon etsiminen','Mietityttääkö jokin asia ennen ostamista? Keskustele täällä askarruttavista asioista.',7,0),(8,'Laina','Keskustele lainansaannista, koroista tai muista laina-asioihin liittyvistä seikoista.',8,0),(9,'Ongelmat','Kumma haju, voiko asunnossa olla hometta? Vuotaako katto? Täällä keskustellaan ikävemmistä aiheista.',9,0),(10,'Katto','Mikä kattomateriaali on paras? Onko harjakatto varmin? Katto-aiheinen keskustelualue.',1,0),(11,'Asiaa ylläpidolle?','Risuja, ruusuja tai ideoita?',10,0);
/*!40000 ALTER TABLE `room` ENABLE KEYS */;
UNLOCK TABLES;

