INSERT INTO `thread` VALUES (1,7,'Utelias','Kerros-, rivi- vai omakotitalo?','Perustele valintasi?',0,0,'2013-07-04 01:42:57',0),(2,4,'Laatta','Laminaatti vai parketti?','Miksi? Mikä on kestävin lapsiperheessä ja mikä on normaalin laminaatin käyttöikä? Entä parketin?',0,0,'2013-07-04 01:43:00',0),(3,1,'Home','Hyvä sivusto homeesta','http://www.hometalkoot.fi/ Kaikki kaikesta! :D',0,0,'2013-07-04 01:43:03',0),(4,4,'iteteen','Olisko hyviä ohjeita','laminaatin laittamiselle netissä? Yksinkertaisia kiitos.',0,0,'2013-07-04 01:43:06',0),(5,1,'Ylläpito','Remonttiaiheisia blogeja pinoon!','Laittakaahan tulemaan omia tai muiden! ;)',0,0,'2013-07-04 01:43:08',0),(6,7,'hhh','Jos valitset asuntojen väliltä kumpi on parempi','alhanen hinta, mutta huonompi alue vai korkea hinta, mutta aluekin hyvä? Kummasta tingit? Vai valitsetko semihyvän alueen jossa keskihinta?',0,0,'2013-07-04 09:55:51',0),(7,9,'Sani','Miten kalliiksi tuli putkiremppa??','Mikä asumismuoto ja pysytykö asumaan asunnossa remontin koko ajan? Minkälaista oli?',0,0,'2013-07-04 01:43:13',0),(8,8,'Lainaaja','Paljonko oli marginaali?','Lainanottovuosi?\r\nMeillä 1,5 eli ilmeisen matala aikaan nähden ja tänä vuonna otettu.',0,0,'2013-07-04 01:43:16',0),(9,1,'Ylläpito','Haemme sivuston aiheeseen sopivia blogeja!','Onko blogisi sistustuksesta, remontoimisesta tai muusta teemaan sopivasta aiheesta?\r\nLinkitä se meille, tai lähetä sähköpostia niin jaamme blogisi näkyvällä paikalla etusivullamme, jotta saisimme oikealle lukijakunnalle mielenkiintoisia blogeja! :)\r\n\r\nMailia voi laittaa osoitteeseen: [url=kotipolku@outlook.com]kotipolku@outlook.com[/url]',1,0,'2013-07-04 11:55:31',0),(10,10,'tasakattoinen','Kuinka huono juttu tasakatto on?','Mitä tulee ottaa huomioon jos ostaa talon ja tasakatto on?\r\nKuinka nopeasti kattoremontti on siis tulossa?',0,0,'2013-07-04 15:13:07',0),(11,11,'kirjautuminen','Miksi ei pysty kirjautumaan?','Eikö tänne voi ollenkaan rekisteröityä?',0,0,'2013-07-04 11:54:31',0),(12,1,'porras','onko jotain valmista materiaalia millä saisi portaisiin nätimm\'n pinnan','Muuten rakenteellisesti kivat portaat, ainoastaan askeleen kohdat rumaa matskua, eli voiko ne päällystää jollain ja millä? Linkkejä? Neuvoja?',0,0,'2013-07-04 20:13:13',0);
